import React, { useState, useEffect } from 'react';
import './RoverDetails.css';

function RoverDetails() {
  const [roverData, setRoverData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/api/rover-details')
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(data => {
        setRoverData(data);
        setLoading(false);
      })
      .catch(err => {
        console.error('Fetch error:', err);
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="rover-container">Loading...</div>;
  if (error) return <div className="rover-container" style={{ color: 'red' }}>Error: {error}</div>;

  return (
    <div className="rover-container">
      <header className="header">
        <h1>Rover Details</h1>
        <p>Real-time status and details of your rover</p>
      </header>
      <section className="rover-content">
        {roverData ? (
          <div className="rover-card">
            <h2>Rover: {roverData.rover_id}</h2>
            <p><strong>Timestamp:</strong> {new Date(roverData.timestamp).toLocaleString()}</p>
            <p><strong>Heading:</strong> {roverData.heading}°</p>
            <p><strong>Mode:</strong> {roverData.mode}</p>
            <p><strong>Armed:</strong> {roverData.armed ? 'Yes' : 'No'}</p>
            <p><strong>System Status:</strong> {roverData.system_status}</p>
            <h3>GPS</h3>
            <p><strong>Latitude:</strong> {roverData.gps?.latitude || 'N/A'}</p>
            <p><strong>Longitude:</strong> {roverData.gps?.longitude || 'N/A'}</p>
            <h3>Battery</h3>
            <p><strong>Level:</strong> {roverData.battery?.level || 'N/A'}%</p>
            <p><strong>Voltage:</strong> {roverData.battery?.voltage || 'N/A'}V</p>
            <h3>Velocity</h3>
            <p><strong>Speed:</strong> {roverData.velocity?.speed || 'N/A'} m/s</p>
            <p><strong>Direction:</strong> {roverData.velocity?.direction || 'N/A'}°</p>
          </div>
        ) : (
          <p>No rover data available.</p>
        )}
      </section>
      <footer className="footer">
        <p>© 2025 ParkSense. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default RoverDetails;
